import React from 'https://esm.sh/react@^18';
import ReactDOM from 'https://esm.sh/react-dom@^18';
import { setBasePath } from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/cdn/utilities/base-path';

// Set the base path for Shoelace assets
setBasePath('https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/')

import SlButton from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/react/button';
import SlDivider from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/react/divider';
import SlDropdown from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/react/dropdown';
import SlMenu from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/react/menu';
import SlMenuItem from 'https://esm.sh/@shoelace-style/shoelace@2.16.0/dist/react/menu-item';

const css = `
  .dropdown-hoist {
    border: solid 2px var(--sl-panel-border-color);
    padding: var(--sl-spacing-medium);
    overflow: hidden;
  }
`;

const App = () => (
  <>
    <SlDropdown>
      <SlButton slot="trigger" caret>Edit</SlButton>

      <SlMenu style="max-width: 200px;">
        <SlMenuItem value="undo">Undo</SlMenuItem>
        <SlMenuItem value="redo">Redo</SlMenuItem>
        <SlDivider />
        <SlMenuItem value="cut">Cut</SlMenuItem>
        <SlMenuItem value="copy">Copy</SlMenuItem>
        <SlMenuItem value="paste">Paste</SlMenuItem>
        <SlDivider />
        <SlMenuItem>
          Find
          <SlMenu slot="submenu">
            <SlMenuItem value="find">Findâ€¦</SlMenuItem>
            <SlMenuItem value="find-previous">Find Next</SlMenuItem>
            <SlMenuItem value="find-next">Find Previous</SlMenuItem>
          </SlMenu>
        </SlMenuItem>
        <SlMenuItem>
          Transformations
          <SlMenu slot="submenu">
            <SlMenuItem value="uppercase">Make uppercase</SlMenuItem>
            <SlMenuItem value="lowercase">Make lowercase</SlMenuItem>
            <SlMenuItem value="capitalize">Capitalize</SlMenuItem>
          </SlMenu>
        </SlMenuItem>
      </SlMenu>
    </SlDropdown>
  </>
);
